import React, { Component } from 'react';

class VendorCard extends React.Component{

  render() {
    const {name,} = this.props.vendorinfo
    return (
      <div key= {name} className="card">
        <h2>{name}</h2>   
      </div>
    );
  }

}

export default VendorCard;
